import React from 'react';
import axios from 'axios';

class App extends React.Component {

	state = {
		details : [],
	}

	componentDidMount() {

		let data ;

		axios.get('http://127.0.0.1:8000/choosequiztype/')
		.then(res => {
			data = res.data;
			this.setState({
				details : data	
			});
			console.log('data:',data)
		})
		.catch(err => {})
	}

	render() {
		return (
		  <Container>
			<Grid>
			  <Grid.Row>
				<Grid.Column>
				  <Header>List</Header>
				  <List>
					{details.map(el => {
					  return (
						<List.Item  key={el.id}>
						  <List.Content>
							{el.names_of_quiz} 
						  </List.Content>
						  <List.Content>{el.description}</List.Content>
						</List.Item>
					  );
					})}
				  </List>
				</Grid.Column>
			  </Grid.Row>
			</Grid>
		  </Container>
		);
	  }
}

export default App;
